import React from "react";
import Aux from "./Auxiliary/Auxiliary"

const ToDoList = (props) => {
    
    return( 
        <Aux>
        <div className = "todo_st">
        <li>{props.text}</li>
        </div>
       
        </Aux>
        )
}

export default ToDoList;
